(712, 1253, 'La pantalla está en proceso de nacionalización, aun no nos ha llegado la nueva pero créame que cuando todo esté listo yo le escribiré.\r\nResponde Cristina Idarraga\r\n ', '2022-02-24 11:35:22'),
(713, 1351, 'El Señor Sebastian dice estar dispuesto a entregar el salvamento, pero cuando el reciba su dinero, que la señora Astrid Restrepo y la agencia de arrendamientos Coninsa no le dan respuesta alguna y satisfactoria.', '2022-02-24 11:40:42'),
(714, 1351, 'La Señora Astrid Restrepo me responde y me dice que no llamemos al afectado, que nos tenemos que entender con el asesor Alejandro. Queda con mi número de celular para que el asesor me contacte. Quedo atenta', '2022-02-24 11:42:49'),
(715, 739, 'Son  cuatro números de contacto en ninguno hay quién responda. Se envió mensaje por WhatsApp, estoy atenta a respuesta del asegurado.', '2022-02-24 12:04:12'),
