(730, 1416, 'No contesta celular\r\nRecoger miércoles 02 de marzo, Vía WhatsApp nos informa el Señor Fernando Toro', '2022-02-28 20:30:20'),
(731, 1417, 'El asegurado no contestó número de contacto, para verificar dirección.', '2022-02-28 20:36:44'),
(732, 1418, 'Informa vía whatsApp cuando y donde recoger', '2022-02-28 20:43:00'),
(733, 1419, '\r\nNos comunicamos por correo.\r\nBuena tarde, Asesora Laura Melisa Benitez\r\nAdjunto oficio, que emite la compañía aseguradora para recoger el salvamento correspondiente a la reclamación 9200000369507.\r\nQuedamos atentos a su oportuna respuesta.\r\n\r\nMuchas gracias por su colaboración.\r\n\r\nCordial saludo\r\n\r\n\r\n', '2022-02-28 20:59:57'),
(734, 1419, 'El mié, 16 feb 2022 a la(s) 16:50, Benitez, Laura (Laura.Benitez@marsh.com) escribió:\r\n Buenas tardes\r\nEnterados, ya dimos traslado al Asegurado para que nos confirmen disponibilidad y persona encargada de la entrega.\r\n\r\n     \r\n\r\n    Saludos,\r\n\r\n     ', '2022-02-28 21:01:48'),
(735, 1419, '28 de febrero,\r\nBuena noche, Señora Laura Benitez\r\nEstamos muy atentos para recoger los elementos de la reclamación 9200000369507\r\nCordial saludo', '2022-02-28 21:02:30'),
(736, 1420, 'Nos confirma cuando recoger ', '2022-02-28 21:25:07'),
(737, 1422, 'No contesta número de contacto', '2022-02-28 21:34:49'),
(738, 1430, 'Romel Martinez, llamará para confirmar recogida', '2022-03-01 08:59:59'),
(739, 1442, 'Cambio de dirección,comparte la nueva vía  whatsApp, para recoger 02 de marzo', '2022-03-01 09:26:43'),
(740, 1440, 'Tiene el equipo en el servicio técnico nos informa cuando lo tenga disponible para recoger', '2022-03-01 09:27:41'),
(741, 1398, 'Lunes 28 de febrero entrego Yeison Cadavid', '2022-03-01 11:57:50'),
(742, 1398, 'Son seis tv. dos video beam, un computador de escritorio y y tres controles de tv. y consola de sonido', '2022-03-01 12:07:02'),
(743, 1432, 'Reclamación:    9210000514887\r\nAsegurado:      Industria de Alimentos AYMARA S.A.S\r\nNúmeros de contacto:   604 446 9855  - 604 3383668 están fuera de servicio. Quedo atenta a otro número de contacto ó de asesor.\r\n', '2022-03-01 12:26:14'),
(744, 1414, 'Sin Cargador', '2022-03-01 21:25:42'),
(745, 1423, 'computador sin cables ni teclado', '2022-03-01 21:29:32'),
(746, 1417, 'Asegurado:    Jorge Alberto Gomez Velez\r\nDirección:      CL 16N 12-02 BELLO HORIZONTE\r\nRecoger en la ciudad de ARMENIA, QUINDÍO\r\nEl asegurado está pendiente para entregarlo', '2022-03-02 10:07:21'),
(747, 1418, 'Se recogió en el servicio técnico', '2022-03-02 10:13:27'),
(748, 1428, 'Se llegó hasta la dirección es de los padres, Daniel esta fuera del país nos llama cuando regrese.No contesta celular porque se lo robaron el fin de semana.', '2022-03-02 21:22:12'),
(749, 1421, 'Recogido en el servicio Técnico, entrego Alfonso Franco', '2022-03-02 21:30:46'),
(750, 1442, 'Recoger 04 de marzo', '2022-03-02 21:31:56'),
(751, 1441, 'Recoger 04 de marzo', '2022-03-02 21:33:51'),
(752, 1405, 'Salvamento:      Bicicleta de marco intese car bine, color negro amarillo,\r\nNúmero de contacto:                    celular    3046772880\r\nEl pasado 18 de febrero se habló con usted vía whatsApp, para coordinar la recogida de este salvamento, según la reclamación que la compañía indemnizo. Su respuesta fue que se encontraba fuera de la ciudad y regresa el 28 de febrero, a la fecha ni vía whatsApp ni celular obtenemos comunicación con usted.\r\nLe agradecemos de antemano su atenta colaboración  para coordinar fecha y nos confirme dirección Y;  así realizar la recogida de la bicicleta.\r\nQuedamos atentos.', '2022-03-03 22:21:43'),
(753, 1432, 'No hay tarjeta ni panel para entregar. El Señor Julián le recomendará al asesor que envié un informe por el cuál no hay salvamento.', '2022-03-03 22:35:38');
